// @ts-nocheck
const METADATA = {
    website: "https://kryzik.com",
    author: "KryziK",
    name: "KryBuild",
    version: "1.0.2",
    id: "kryzik-kry-build",
    modId: "2428941",
    description: "Provides mirrored versions of existing buildings.",
    minimumGameVersion: ">=1.5.6",
};

const Variants = { default: "default", mirrored: "mirrored", double: "double", double_mirrored: "double_mirrored", quad: "quad", quad_mirrored: "quad_mirrored" };
const VARIANT_SORT_ORDER = [Variants.mirrored, Variants.double, Variants.double_mirrored, Variants.quad, Variants.quad_mirrored];

const byVariant = (a, b) => VARIANT_SORT_ORDER.indexOf(a) - VARIANT_SORT_ORDER.indexOf(b);

const getBaseVariant = variant =>
    variant.substring(0, variant.indexOf("_")) || (variant !== Variants.mirrored ? variant : shapez.defaultBuildingVariant);

class Mod extends shapez.Mod {
    findBuildingInRegistry = predicate => shapez.gMetaBuildingRegistry.entries.filter(predicate)[0];

    getBuilding = metaClassOrInstanceOrId => {
        if (metaClassOrInstanceOrId instanceof shapez.MetaBuilding)
            return metaClassOrInstanceOrId;

        if (typeof metaClassOrInstanceOrId === "function")
            return this.findBuildingInRegistry(e => e.constructor.name === metaClassOrInstanceOrId.name);

        throw new Error("Can't getBuilding");
    };

    getBaseVariantInfo = (metaClassOrInstanceOrId, variant) => {
        const baseBuilding = this.getBuilding(metaClassOrInstanceOrId);
        const variantBase = getBaseVariant(variant);

        return {
            dimensions: baseBuilding.getDimensions(variantBase),

            blueprintSpriteBase64: RESOURCES[baseBuilding.id][variant],
            regularSpriteBase64: RESOURCES[baseBuilding.id][variant],
            tutorialImageBase64: RESOURCES[baseBuilding.id][`tut_${variant}`],

            additionalStatistics: root => baseBuilding.getAdditionalStatistics(root, variantBase),
            isUnlocked: root => baseBuilding.getIsUnlocked(root)
        };
    };

    registerNewBuildingVariant = (metaClassOrInstanceOrId, variant, variantInfo) => {
        const building = this.getBuilding(metaClassOrInstanceOrId);
        const variantEnumName = building.constructor.name.replace(/Meta(.+)Building/, "enum$1Variants");

        (shapez[variantEnumName] || (shapez[variantEnumName] = {}))[variant] = variant;
        this.modInterface.addVariantToExistingBuilding(building.constructor, variant, { ...this.getBaseVariantInfo(building, variant), ...(variantInfo || {}) });
        (this.addedVariants || (this.addedVariants = [])).push(variant);
    };

    extendBuilding = metaClass =>
        this.modInterface.extendClass(metaClass, (mod => ({ $old }) => ({
            getAvailableVariants: root => $old.getAvailableVariants.call(this, root).sort(byVariant),

            updateVariants(entity, rotationVariant, variant) {
                mod.updateEntity(entity, mod.cacheGetOrAdd(this, entity, $old, rotationVariant, variant));
            }
        }))(this));

    cloneSlots = slots => slots.map(s => ({ ...s, pos: s.pos.copy() }));

    mirrorSlots = (slots, dimensions) =>
        slots?.map(s => ({
            ...s,
            pos: new shapez.Vector(dimensions.x - 1 - s.pos.x, s.pos.y),
            direction: [shapez.enumDirection.top, shapez.enumDirection.bottom].includes(s.direction)
                ? s.direction
                : shapez.enumInvertedDirections[s.direction]
        }));

    updateEntity = (entity, cachedEntity) => {
        if (cachedEntity.WiredPinsSlots?.length > 0) {
            if (!entity.components.WiredPins)
                entity.addComponent(new shapez.WiredPinsComponent({ slots: [] }));
        } else if (entity.components.WiredPins)
            entity.removeComponent(shapez.WiredPinsComponent);

        entity.components.ItemAcceptor?.setSlots(cachedEntity.ItemAcceptorSlots);
        entity.components.ItemEjector?.setSlots(cachedEntity.ItemEjectorSlots);
        entity.components.WiredPins?.setSlots(cachedEntity.WiredPinsSlots);

        if (entity.components.ItemProcessor) {
            entity.components.ItemProcessor.type = cachedEntity.ItemProcessor.type;
            entity.components.ItemProcessor.processingRequirement = cachedEntity.ItemProcessor.processingRequirement;
            entity.components.ItemProcessor.inputsPerCharge = cachedEntity.ItemProcessor.inputsPerCharge;
        }
    };

    cacheGetOrAdd = (metaNew, entity, metaOld, rotationVariant, variant) => {
        let cacheEntry = this.componentCache[metaNew.id][variant];

        if (!cacheEntry || Object.keys(cacheEntry).length === 0) {
            const baseVariant = getBaseVariant(variant);

            if (variant !== baseVariant) {
                let baseCacheEntry = this.cacheGetOrAdd(metaNew, entity, metaOld, rotationVariant, baseVariant);
                if (this.addedVariants.includes(variant)) {
                    cacheEntry = {
                        ItemAcceptorSlots: this.mirrorSlots(baseCacheEntry.ItemAcceptorSlots, metaNew.getDimensions(variant)),
                        ItemEjectorSlots: this.mirrorSlots(baseCacheEntry.ItemEjectorSlots, metaNew.getDimensions(variant)),
                        WiredPinsSlots: this.mirrorSlots(baseCacheEntry.WiredPinsSlots, metaNew.getDimensions(variant)),
                        ItemProcessor: baseCacheEntry.ItemProcessor
                    };
                }
            } else {
                metaOld.updateVariants.call(metaNew, entity, rotationVariant, variant);
                cacheEntry = {};

                if (entity.components.ItemAcceptor?.slots && !cacheEntry.ItemAcceptorSlots)
                    cacheEntry.ItemAcceptorSlots = this.cloneSlots(entity.components.ItemAcceptor.slots);

                if (entity.components.ItemEjector?.slots)
                    cacheEntry.ItemEjectorSlots = this.cloneSlots(entity.components.ItemEjector.slots);

                if (entity.components.WiredPins?.slots)
                    cacheEntry.WiredPinsSlots = this.cloneSlots(entity.components.WiredPins.slots);

                if (entity.components.ItemProcessor)
                    cacheEntry.ItemProcessor = {
                        type: entity.components.ItemProcessor.type,
                        processingRequirement: entity.components.ItemProcessor.processingRequirement,
                        inputsPerCharge: entity.components.ItemProcessor.inputsPerCharge
                    };
            }

            this.componentCache[metaNew.id][variant] = cacheEntry;
        }

        return cacheEntry;
    };

    init = () => {
        this.componentCache = shapez.gMetaBuildingRegistry.entries.reduce((a, v) => ({ ...a, [v.id]: {} }), {});

        this.registerNewBuildingVariant(shapez.MetaCutterBuilding, Variants.mirrored, { name: "Cutter (Mirrored)", description: "A mirrored Cutter building." });
        this.registerNewBuildingVariant(shapez.MetaCutterBuilding, Variants.quad_mirrored, { name: "Cutter (Quad)<br>[Mirrored]", description: "A mirrored Quad Cutter building." });
        this.registerNewBuildingVariant(shapez.MetaStackerBuilding, Variants.mirrored, { name: "Stacker (Mirrored)", description: "A mirrored Stacker building." });
        this.registerNewBuildingVariant(shapez.MetaMixerBuilding, Variants.mirrored, { name: "Mixer (Mirrored)", description: "A mirrored Mixer building." });
        this.registerNewBuildingVariant(shapez.MetaPainterBuilding, Variants.double_mirrored, { name: "Painter (Double)<br>[Mirrored]", description: "A mirrored Double Painter building." });
        this.registerNewBuildingVariant(shapez.MetaPainterBuilding, Variants.quad_mirrored, { name: "Painter (Quad)<br>[Mirrored]", description: "A mirrored Quad Painter building." });
        this.registerNewBuildingVariant(shapez.MetaFilterBuilding, Variants.mirrored, { name: "Filter (Mirrored)", description: "A mirrored Filter building." });
        this.registerNewBuildingVariant(shapez.MetaStorageBuilding, Variants.mirrored, { name: "Storage (Mirrored)", description: "A mirrored Storage building." });

        this.extendBuilding(shapez.MetaCutterBuilding);
        this.extendBuilding(shapez.MetaStackerBuilding);
        this.extendBuilding(shapez.MetaMixerBuilding);
        this.extendBuilding(shapez.MetaPainterBuilding);
        this.extendBuilding(shapez.MetaFilterBuilding);
        this.extendBuilding(shapez.MetaStorageBuilding);
    };
}

const RESOURCES = {
    cutter: {
        [Variants.mirrored]: "data:image/png;base64,",
        [`tut_${Variants.mirrored}`]: "data:image/png;base64,",
        [Variants.quad_mirrored]: "data:image/png;base64,",
        [`tut_${Variants.quad_mirrored}`]: "data:image/png;base64,"
    },
    filter: {
        [Variants.mirrored]: "data:image/png;base64,",
        [`tut_${Variants.mirrored}`]: "data:image/png;base64,"
    },
    mixer: {
        [Variants.mirrored]: "data:image/png;base64,",
        [`tut_${Variants.mirrored}`]: "data:image/png;base64,"
    },
    painter: {
        [Variants.double_mirrored]: "data:image/png;base64,",
        [`tut_${Variants.double_mirrored}`]: "data:image/png;base64,",
        [Variants.quad_mirrored]: "data:image/png;base64,",
        [`tut_${Variants.quad_mirrored}`]: "data:image/png;base64,"
    },
    stacker: {
        [Variants.mirrored]: "data:image/png;base64,",
        [`tut_${Variants.mirrored}`]: "data:image/png;base64,"
    },
    storage: {
        [Variants.mirrored]: "data:image/png;base64,",
        [`tut_${Variants.mirrored}`]: "data:image/png;base64,"
    }
};